INSERT INTO ud.factions VALUES (1, 'Lawful Neutral', 'A highly structured empire valuing order and hierarchy above all, ruling multiple star systems with strict bureaucracy.', 'Celestian Imperium', 'Galactic Empire', 0, 12, true, '2026-01-11 23:21:05.73115', '2026-01-11 23:21:05.750002');
