INSERT INTO ud.factions VALUES (106, 'Lawful Good', 'A pioneering alliance of the Sol, Alpha Centauri, and Proxima systems, the first multi-system attempt at interstellar governance, promoting diplomacy, cooperation, and shared defense.', 'The Tri-Systems', 'Galactic', 100, 15, false, '2026-01-12 01:22:42.952052', '2026-01-12 01:22:42.952052');
INSERT INTO ud.factions VALUES (107, 'Lawful Evil', 'A coalition of powerful interstellar corporations united to resist The Tri-Systems'' influence. They are cold, militaristic, and prioritize profit over ethics, often exploiting slaves or workers under harsh conditions.', 'The Corporate Powers', 'Galactic', 100, 18, false, '2026-01-12 01:29:32.260798', '2026-01-12 01:29:32.260798');
INSERT INTO ud.factions VALUES (108, 'Chaotic Good', 'A covert resistance network composed mostly of former corporate citizens who escaped exploitation. The Union exposes The Powers through espionage, rebel newscasts, and supports uprisings in corporation-controlled systems.', 'The Union', 'Outlaw', 100, 38, false, '2026-01-12 01:36:15.301826', '2026-01-12 01:36:15.301826');